import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Link, Route } from "react-router-dom";
import * as ReactBootstrap from "react-bootstrap";

import Home from "./components/home";
import About from "./components/about";
import Contact from "./components/contact";

import logo from "./logo.svg";
class App extends Component {
  render() {
    return (
      <Router>
        <div className="container">
          <ReactBootstrap.Navbar collapseOnSelect expand="lg" bg="lt" variant="lt">
        <ReactBootstrap.Navbar.Brand href="#home">
          <img src="arcs logo 1.png" alt="Logo" className="logo" />
        </ReactBootstrap.Navbar.Brand>
        <ReactBootstrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />


        <ReactBootstrap.Navbar.Collapse id="responsive-navbar-nav">

          <ReactBootstrap.Nav className="mr-auto">
            <ReactBootstrap.Nav.Link href="#features">Features</ReactBootstrap.Nav.Link>
            <ReactBootstrap.Nav.Link href="#pricing">Pricing</ReactBootstrap.Nav.Link>
            <ReactBootstrap.NavDropdown title="Dropdown" id="collasible-nav-dropdown">
              <ReactBootstrap.NavDropdown.Item href="#action/3.1">Action</ReactBootstrap.NavDropdown.Item>
              <ReactBootstrap.NavDropdown.Item href="#action/3.2">Another action</ReactBootstrap.NavDropdown.Item>
              <ReactBootstrap.NavDropdown.Item href="#action/3.3">Something</ReactBootstrap.NavDropdown.Item>
              <ReactBootstrap.NavDropdown.Divider />
              <ReactBootstrap.NavDropdown.Item href="#action/3.4">Separated link</ReactBootstrap.NavDropdown.Item>
            </ReactBootstrap.NavDropdown>
          </ReactBootstrap.Nav>

          <ReactBootstrap.Nav>
            <ReactBootstrap.Nav.Link href="about us">About Us</ReactBootstrap.Nav.Link>
            <ReactBootstrap.Nav.Link eventKey={2} href="#memes">Chairman’s Message</ReactBootstrap.Nav.Link>
            <ReactBootstrap.Nav.Link href="#pricing">What we do</ReactBootstrap.Nav.Link>
            <ReactBootstrap.Nav.Link href="contact Us">Contact Us</ReactBootstrap.Nav.Link>

          </ReactBootstrap.Nav>


        </ReactBootstrap.Navbar.Collapse>
      </ReactBootstrap.Navbar>




        <Route path="/" exact component={Home} />
        <Route path="/about us" component={About} />
        <Route path="/contact us" component={Contact} />
        </div>

      </Router>
    );
  }
}


export default App;
